package corejava;

public class overloading {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		numbers(6);
		number(6.7);
	}

	public static void numbers(int c) {
		System.out.println(c);
}
	public static void number(double c) {
		System.out.println(c);
	}
}
